CREATE DATABASE majidDB;
use majidDB;

CREATE TABLE campaigns
(
  ID INT
  AUTO_INCREMENT PRIMARY KEY,
  CAMPAIGN_NAME VARCHAR
  (10) NOT NULL,
  CAMPAIGN_TYPE VARCHAR
  (8) NOT NULL,
  CAMPAIGN_DATE DATE NOT NULL,
  DEPARTMENT_CAT VARCHAR
  (12) NOT NULL,
  SECTION_CAT VARCHAR
  (9) NOT NULL,
  FAMILY_CAT VARCHAR
  (8) NOT NULL,
  SUBFAMILY_CAT VARCHAR
  (11) NOT NULL,
  PRODUCT_ID INTEGER NOT NULL,
  PRODUCT_DESC VARCHAR
  (15) NOT NULL,
  INCR_SALES NUMERIC
  (13,5) NOT NULL,
  INCR_SALES_PER NUMERIC
  (8,4) NOT NULL,
  INCR_MARGIN NUMERIC
  (13,5) NOT NULL,
  INCR_TRAFFIC NUMERIC
  (9,4),
  INCR_BASKET NUMERIC
  (8,5),
  INCR_TSE NUMERIC
  (12,4),
  IPROMO_DEPTH NUMERIC
  (7,5),
  TOTAL_SALES NUMERIC
  (12,4) NOT NULL,
  VOLUME_SOLD NUMERIC
  (12,5) NOT NULL,
  PROMO_PRICE NUMERIC
  (9,4),
  SLASH_PRICE NUMERIC
  (9,4),
  COST_PRICE NUMERIC
  (10,5) NOT NULL,
  INCR_TRAFFIC_PER VARCHAR
  (4),
  INCR_BASKET_PER VARCHAR
  (4),
  INCR_TSE_PER VARCHAR
  (4),
  PROMO_MECHANIC VARCHAR
  (17),
  SUPPLIER_ID NUMERIC
  (9,2) NOT NULL
);

